public class VariableExample{
   int myVariable;
   static int data = 30;

   void sam() {
       System.out.println("myVariable 1 " + myVariable);      // Line 1
       VariableExample obj1 = new VariableExample();
       System.out.println("myVariable 2 " + obj1.myVariable); // Line 2
   }

   public static void main(String args[]){
      VariableExample obj = new VariableExample();

      System.out.println("myVariable 3 "+obj.myVariable);    // Line 3
      System.out.println("Value of static variable: "+VariableExample.data);
      obj.sam();
      System.out.println("myVariable 4 " + myVariable);      // Line 4
   }
}
